const Game = () => {

    const [questions, setQuestions] = useState([]);
    let { data } = useContext(AuthContext);
    console.log(data);

    return (
        <Box>
        {data && data.map((dataItem) => {
            return (
                <p key={dataItem.id}>{dataItem.question}</p>
            )
        })}
        <Button>Next Question</Button>
    </Box>
    );
}

export default Game;
